import React, { useContext } from "react";
import { BrowserRouter } from "react-router-dom";
import AuthContext from "./store/auth-context";
import {NavBar, AppRouter} from "./components/route";
import {
  experimental_extendTheme as materialExtendTheme,
  Experimental_CssVarsProvider as MaterialCssVarsProvider,
  THEME_ID as MATERIAL_THEME_ID,
} from '@mui/material/styles';
import { CssVarsProvider as JoyCssVarsProvider } from '@mui/joy/styles';
import CssBaseline from '@mui/material/CssBaseline';
import Container from "@material-ui/core/Container";
import style from "./css/common.module.css";
import backimg from "./img/background.png";

const materialTheme = materialExtendTheme();

export default function App() {
  const ctx = useContext(AuthContext);

  return (
    <MaterialCssVarsProvider theme={{ [MATERIAL_THEME_ID]: materialTheme }}>
      <JoyCssVarsProvider>
        <CssBaseline enableColorScheme />
        ...Material UI and Joy UI components
    <BrowserRouter style={style}>
      {!["home", "user-home"].includes(ctx.currentPage) && <NavBar />}
      <Container>
        <AppRouter />
      </Container>
    </BrowserRouter>
      </JoyCssVarsProvider>
    </MaterialCssVarsProvider>
  );
}
